import React, { Component } from 'react'
import '../styles/About.scss'

class About extends Component {
    render(){
        return(
            <div id ='headerDiv'>
                <span id = 'headerName'>Matthew Abrey</span>
                <button id = 'hamburgerMenu'>{String.fromCharCode(9776)}</button>
            </div>
        );
    }
}
export default About
